window.bookSummaryJSON = "<p>Nestor and Nathan Kiklu are the twin sons of Harry Keogh, the Necroscope. United by blood, they also share some of their father's awesome powers - but what they do with those gifts cannot be more different!</p> <p>Nathan takes up the struggle against the metamorphic vampires, while Nestor, fascinated by the vampires' eerie evil, has become his twin's worst nightmare: A Wamphyri Lord!</p> <p>Harry Keogh's sons have become the bitterest of enemies, each determined to destroy the other. When next they meet, one will surely die!</p> <p>At the Publisher's request, this title is being sold without Digital Rights Management Software (DRM) applied.</p>"; 
